import { Link } from 'react-router-dom';

export default class Navbar extends Component {

  render() {
    return (
      <div>
          <div id="logscrn">
              Login Screen
          </div>
          <form>
            <label>
                Name:
                <input type="text" name="name" />
            </label>
            <input type="submit" value="Submit" />
            </form>
      </div>
    );
  }
}
